import { useState, useEffect } from "react";
import { ListGroup } from "react-bootstrap";

function App() {
  const [people, setPeople] = useState([]);

  useEffect(() => {
    async function fetchData() {
      const resp = await fetch("https://www.swapi.tech/api/people/");

      const data = await resp.json();

      console.log(data);
      const { results } = data;
      setPeople(results);
    }

    fetchData();

    return () => {};
  }, []);

  console.log(people);

  return (
    <div>
      <h1>SWAPI</h1>

      <ListGroup>
        {people &&
          people.map((person) => {
            return (
              <ListGroup.Item
                action
                as="li"
                href={`/people/${person.uid}`}
                key={person.uid}
              >
                {person.name}
              </ListGroup.Item>
            );
          })}
      </ListGroup>
    </div>
  );
}

export default App;
